window.bookSummaryJSON = "<p>Craig Johnsonâ€™s rough-and-tumble hero Walt Longmire is quickly becoming a fan-favorite and a critical success.</p> <p>Here Walt has his hands full as greedy land developers employ shady, violent methods to reverse their fortunes in recession-racked Wyoming, where the owners of a multi-million dollar development of ranchettes want to get rid of the adjacent junk-yard. When a severed thumb is discovered in the yard, conflicts erupt, and Walt Longmire, his trusty companion Dog, life-long friend Henry Standing Bear, and deputies Santiago Saizarbitoria and Victoria Moretti find themselves in a small town that feels more and more like a high plains pressure cooker.</p>"; 
